import React, { Component } from 'react'

// Variant 1
// console.log(8320%2+1);

export default class Animal {
    constructor(options) {
        this.name = options.name
        this.age = options.age
        this.hasTail = options.hasTail
    }
}

const animal = new Animal({
    name: 'Animal', 
    age: 5,
    hasTail: true
})
